import sys

def solve():
    K, G, M = map(int, sys.stdin.read().split())
    glass = 0
    mug = 0
    for _ in range(K):
        if glass == G:
            glass = 0
        elif mug == 0:
            mug = M
        else:
            transfer = min(mug, G - glass)
            glass += transfer
            mug -= transfer
    print(glass, mug)

if __name__ == "__main__":
    solve()

