import sys

def solve():
    n = int(sys.stdin.readline())
    if n < 2:
        print([])
        return
    sieve = [True] * (n + 1)
    sieve[0] = sieve[1] = False
    for i in range(2, int(n**0.5) + 1):
        if sieve[i]:
            sieve[i*i : n+1 : i] = [False] * len(sieve[i*i : n+1 : i])
    pairs = []
    for x in range(2, n//2 + 1):
        y = n - x
        if sieve[x] and sieve[y]:
            pairs.append([x, y])
    print(pairs)

if __name__ == "__main__":
    solve()

