import sys

def solve():
    nums = list(map(int, sys.stdin.read().split()))
    ones = [i for i, num in enumerate(nums) if num == 1]
    mod = 10**9 + 7
    if len(ones) < 1:
        print(0)
    elif len(ones) == 1:
        print(1)
    else:
        res = 1
        for i in range(1, len(ones)):
            gap = ones[i] - ones[i-1] - 1
            res = res * (gap + 1) % mod
        print(res)

if __name__ == "__main__":
    solve()

import sys

def is_palindrome(n):
    s = str(n)
    return s == s[::-1]

def solve():
    N = int(sys.stdin.readline())
    max_pal_cube = 0
    x = 1
    while True:
        cube = x ** 3
        if cube > N:
            break
        if is_palindrome(cube):
            if cube > max_pal_cube:
                max_pal_cube = cube
        x += 1
    print(max_pal_cube)

if __name__ == "__main__":
    solve()

