def solve():
    n = int(sys.stdin.readline())
    s = sys.stdin.readline().strip()
    count_t = s.count('T')
    count_a = s.count('A')
    if count_t > count_a:
        print('T')
    elif count_a > count_t:
        print('A')
    else:
        required = n // 2
        t_count = 0
        a_count = 0
        for c in s:
            if c == 'T':
                t_count += 1
            else:
                a_count += 1
            if t_count == required:
                print('T')
                break
            if a_count == required:
                print('A')
                break

if __name__ == "__main__":
    solve()

import sys

def solve():
    n = int(sys.stdin.readline())
    s = sys.stdin.readline().strip()
    if n == 0:
        print(0)
        return
    runs = []
    current_char = s[0]
    current_length = 1
    for c in s[1:]:
        if c == current_char:
            current_length += 1
        else:
            runs.append((current_char, current_length))
            current_char = c
            current_length = 1
    runs.append((current_char, current_length))

    max_len = {}
    for char, length in runs:
        if char in max_len:
            if length > max_len[char]:
                max_len[char] = length
        else:
            max_len[char] = length
    print(sum(max_len.values()))

if __name__ == "__main__":
    solve()

